%spark
import java.sql.Connection
import java.sql.DriverManager
import org.apache.spark.sql.types._
import org.apache.spark.sql.Row

val thinUrl = "jdbc:phoenix:thin:url=http://phoenix.dev:8765;serialization=PROTOBUF"
val connection = DriverManager.getConnection(thinUrl)

//Helper for turning JDBC query results into a DataSet
val queryToDS = (conn: Connection, query: String) => {
    val rs = conn.createStatement().executeQuery(query)
    val rsmd = rs.getMetaData()

    //Build a schema object
    var schemaString = rsmd.getColumnName(1)
    for ( i <- 2 to rsmd.getColumnCount() ){
        schemaString = schemaString + " " + rsmd.getColumnName(i)
    }
    val fields = schemaString.split(" ")
      .map(fieldName => StructField(fieldName, StringType, nullable = true))
    val schema = StructType(fields)

    //Convert resultset into DataFrame row by row
    var rows = Array[Row]()
    while (rs.next()){
      //Convert fields of each result set row into an array of Strings
      val fields = schemaString.split(" ")
      var row = Array[String]()
      for ( i <- 0 to fields.size-1 ){
        val fieldVal = if (rs.getString(fields(i)) == null) "" else rs.getString(fields(i)).trim
        row = row :+ fieldVal
      }
      rows = rows :+ Row(row:_*)
    }
    spark.createDataFrame(sc.parallelize(rows), schema)
}

%angular
<!-- Avoid constantly editing JS and list the Angular vars you want exposed in an HTML attribute: -->
<div id="dummy" vars="id,parents,children,poidevice,childrenStr,parentsStr,devicetopology"></div>
<script type="text/javascript">
  //Given an element in the note & list of values to fetch from Spark
  //window.angularVars.myVal will be current value of backend Spark val of same name
  function hoist(element){
    var varNames = element.attr('vars').split(',');
    window.angularVars = {};
    var scope = angular.element(element.parent('.ng-scope')).scope().compiledScope;
    $.each(varNames, function(i, v){
      window[v+'-watcher'] = scope.$watch(v, function(newVal, oldVal){
        window.angularVars[v] = newVal;
      });
    });
  }
  hoist($('#dummy'));
</script>

%angular
<div id="map" style="height:500px;width:100%;"></div>
<script type="text/javascript">
function circle(pos, color, info, map){
    var circle = new google.maps.Circle({
        strokeColor: color,
        strokeOpacity: 0.8,
        strokeWeight: 2,
        fillColor: color,
        fillOpacity: 0.35,
        map: map,
        center: pos,
        radius: 30000   //default: 6.5
    });
    var info = new google.maps.InfoWindow({content: info});
    circle.addListener('click', function(){
        info.open(map, circle);
        info.setPosition(circle.getCenter());
    });
}

function line(coords, dashed, map){
    var lineConf = {
        path: coords,
        geodesic: true,
        strokeColor: '#000000',
        strokeOpacity: 0.75,
        strokeWeight: 2  // default = 1
    };
    if (dashed) lineConf.icons = [{
        icon: { path: 'M 0,-1 0,1', strokeOpacity: 1, scale: 3 },
        offset: '0',
        repeat: '20px'
    }];
    var path = new google.maps.Polyline(lineConf);
    path.setMap(map);
}

function initMap() {
    var id = window.angularVars.id;
    var poidevice = window.angularVars.poidevice;
    var children = window.angularVars.children;
    var childrenStr = window.angularVars.childrenStr;
    var parents = window.angularVars.parents;
    var parentsStr = window.angularVars.parentsStr;
    var devicetopology = window.angularVars.devicetopology;
    var POIs = {};

    console.log('POI Value: ' + poidevice[0].values);
    console.log('Topology Value: ' + devicetopology[0].values.toString().split("|")[0]);

    var USA = {lat: 39.8282, lng: -98.5795};
    var map = new google.maps.Map(document.getElementById('map'), {zoom: 5, center: USA });

    //**********************************************************************************
    //
    //  Draw circle POI Device
    //
    //**********************************************************************************
    $.each(poidevice, function(i, v){
        POIs[v.values[0]] = v.values;
        //Create marker for each POI
        var pos = {lat: parseFloat(v.values[5]), lng: parseFloat(v.values[4]) };
        var color = (v.values[11] == '1.0') ? '#FF0000' : '#008000';
        var info = '<b>IP</b>: ' + v.values[0] + '<p><b>ISP:</b> ' + v.values[6] + '<p>' + v.values[3] + ", " + v.values[2];
        console.log('Drawing POI device: ' + v.values[0] + ' ' + JSON.stringify(pos) + ' ' + v.values[5] + ',' + v.values[4]);
        circle(pos, color, info, map);
    });

    //**********************************************************************************
    //
    //  Draw circles for each Parent POI
    //
    //**********************************************************************************
    $.each(parents, function(i, v){
        POIs[v.values[0]] = v.values;
        //Create marker for each POI
        var pos = {lat: parseFloat(v.values[5]), lng: parseFloat(v.values[4]) };
        var color = (v.values[11] == '1.0') ? '#FF0000' : '#008000';
        var info = '<b>IP</b>: ' + v.values[0] + '<p><b>ISP:</b> ' + v.values[6] + '<p>' + v.values[3] + ", " + v.values[2];
        console.log('Drawing parent device: ' + v.values[0] + ' ' + JSON.stringify(pos) + ' ' + v.values[5] + ',' + v.values[4]);
        circle(pos, color, info, map);
    });

    //**********************************************************************************
    //
    //  Draw circles for each Child POI
    //
    //**********************************************************************************
    $.each(children, function(i, v){
        POIs[v.values[0]] = v.values;
        //Create marker for each POI
        var pos = {lat: parseFloat(v.values[5]), lng: parseFloat(v.values[4]) };
        var color = (v.values[11] == '1.0') ? '#FF0000' : '#008000';
        var info = '<b>IP</b>: ' + v.values[0] + '<p><b>ISP:</b> ' + v.values[6] + '<p>' + v.values[3] + ", " + v.values[2];
        console.log('Drawing child device: ' + v.values[0] + ' ' + JSON.stringify(pos) + ' ' + v.values[5] + ',' + v.values[4]);
        circle(pos, color, info, map);
    });

    //**********************************************************************************
    //
    //  Draw Google Maps polylines
    //
    //**********************************************************************************

    var POI = poidevice[0].values;
    var start = {lat: parseFloat(POI[5]), lng: parseFloat(POI[4])};

    var coords     = [];
    var seen_cords = [];
    //var coords = [start];

    // Loop through each device topology that contains POI
    $.each(devicetopology, function(j, k){
        var topology = k.values.toString().split("|");
        var coords     = [];
        var seen_cords = [];
        for (i = 0; i < topology.length; i++) {
            try{
                var lat = POIs[topology[i]][5];
                var lon = POIs[topology[i]][4];
                //if ( seen_cords.indexOf(lat + '_' + lon) == -1 ){
                    //coords.push({lat: parseFloat(POIs[topology[i]][5]), lng: parseFloat(POIs[topology[i]][4]) });
                    coords.push({lat: parseFloat(lat), lng: parseFloat(lon) });
                    seen_cords.push(lat + '_' + lon);
                    //console.log("seen cords: " + lat + '_' + lon);
                //};
            }
            catch (exception) {
            };
        };
        console.log('Drawing topology ' + JSON.stringify(coords));
        line(coords, false, map);
    });

    map.setCenter(start);

}

//Only load GMaps once
if (typeof google === 'object' && typeof google.maps === 'object') initMap();
else {
    var script = document.createElement("script");
    script.type = "text/javascript";
    //Replace with your API key
    //var apiKey = 'AIzaSyAo9kHi0vp_Up_iqeUNyDOzxiaVan8CY50';
    var apiKey = 'AIzaSyDelWwzG32w6aDi9WsLiw2qP_JHAbQHG3A';
    script.src = "https://maps.googleapis.com/maps/api/js?key="+apiKey+"&callback=initMap";
    document.body.appendChild(script);
}
</script>
